   'enc_ContextParameterValueType'(Val, TagIn);

'enc_ContextParameterValueType'(Val, TagIn) ->
   {EncBytes,EncLen} = case element(1,Val) of
      boolean ->
         ?RT_BER:encode_boolean(element(2,Val), [<<128>>]);
      integer32 ->
         ?RT_BER:encode_integer([], element(2,Val), [<<129>>]);
      integer64 ->
         ?RT_BER:encode_integer([], element(2,Val), [<<130>>]);
      unsigned32 ->
         ?RT_BER:encode_integer([], element(2,Val), [<<131>>]);
      unsigned64 ->
         ?RT_BER:encode_integer([], element(2,Val), [<<132>>]);
      addressString ->
         ?RT_BER:encode_octet_string([], element(2,Val), [<<133>>]);
      octetString ->
         ?RT_BER:encode_octet_string([], element(2,Val), [<<134>>]);
      string ->
         ?RT_BER:encode_UTF8_string([], element(2,Val), [<<135>>]);
      time ->
         'enc_Time'(element(2,Val), [<<168>>]);
      partyInformation ->
         'enc_PartyInformation'(element(2,Val), [<<169>>]);
      Else -> 
         exit({error,{asn1,{invalid_choice_type,Else}}})
   end,

?RT_BER:encode_tags(TagIn, EncBytes, EncLen).




