   {'SCFPDPRecord', Term1, Term2, Term3, Term4, Term5, Term6, Term7, Term8, Term9, Term10, Term11, Term12, Term13, Term14, Term15, Term16, Term17, Term18, Term19, Term20, Term21, Term22, Term23, Term24, Term25, Term26, Term27, Term28, Term29, Term30, Term31, Term32, Term33, Term34, Term35, Term36, Term37}.



%%================================
%%  ChargingDataOutputRecord
%%================================
'enc_ChargingDataOutputRecord'(Val) ->
    'enc_ChargingDataOutputRecord'(Val, []).


'enc_ChargingDataOutputRecord'({'ChargingDataOutputRecord',Val}, TagIn) ->
   'enc_ChargingDataOutputRecord'(Val, TagIn);

'enc_ChargingDataOutputRecord'(Val, TagIn) ->
   {EncBytes,EncLen} = case element(1,Val) of
      sCFPDPRecord ->
         'enc_SCFPDPRecord'(element(2,Val), [<<160>>]);
      sCFSMSPSMORecord ->
         'enc_SCFSMSMORecord'(element(2,Val), [<<161>>]);
      sCFSMSCSMORecord ->
         'enc_SCFSMSMORecord'(element(2,Val), [<<162>>]);
      diameterCreditControlRecord ->
         'enc_DiameterCreditControlRecord'(element(2,Val), [<<163>>]);
      fBCRatingRecord ->
         'enc_FBCRatingRecord'(element(2,Val), [<<164>>]);
      rTCCreditControlRecord ->
         'enc_RTCCreditControlRecord'(element(2,Val), [<<165>>]);
      onlineCreditControlRecord ->
         'enc_OnlineCreditControlRecord'(element(2,Val), [<<166>>]);
      Else -> 
         exit({error,{asn1,{invalid_choice_type,Else}}})
   end,

?RT_BER:encode_tags(TagIn, EncBytes, EncLen).




'dec_ChargingDataOutputRecord'(Tlv) ->
   'dec_ChargingDataOutputRecord'(Tlv, []).

'dec_ChargingDataOutputRecord'(Tlv, TagIn) ->
Tlv1 = ?RT_BER:match_tags(Tlv,TagIn), 
case (case Tlv1 of [CtempTlv1] -> CtempTlv1; _ -> Tlv1 end) of

%% 'sCFPDPRecord'
    {131072, V1} -> 
        {sCFPDPRecord, 'dec_SCFPDPRecord'(V1, [])};


%% 'sCFSMSPSMORecord'
    {131073, V1} -> 
        {sCFSMSPSMORecord, 'dec_SCFSMSMORecord'(V1, [])};


%% 'sCFSMSCSMORecord'
    {131074, V1} -> 
        {sCFSMSCSMORecord, 'dec_SCFSMSMORecord'(V1, [])};


%% 'diameterCreditControlRecord'
    {131075, V1} -> 
        {diameterCreditControlRecord, 'dec_DiameterCreditControlRecord'(V1, [])};


%% 'fBCRatingRecord'
    {131076, V1} -> 
        {fBCRatingRecord, 'dec_FBCRatingRecord'(V1, [])};


%% 'rTCCreditControlRecord'
    {131077, V1} -> 
        {rTCCreditControlRecord, 'dec_RTCCreditControlRecord'(V1, [])};


%% 'onlineCreditControlRecord'
    {131078, V1} -> 
        {onlineCreditControlRecord, 'dec_OnlineCreditControlRecord'(V1, [])};

      Else -> 
         {asn1_ExtAlt, ?RT_BER:encode(Else)}
   end
.
